import React from 'react';
import '../../App.css';
import  './AboutCont.css';

function AboutCont() {
  return (
    <div className='about-wrapper'>
        <div className='about-container'>
      <h4>This website was developed as a project for EG6328 - Software Engineering - at
          St. Mary's University. The inspiritaion behind this idea is that we wanted to create
          a centralized point of contact for students, tutors, and professors. This site offers
          a  convenient all-in-one-place for students to contact each in a private and secure manner
          regarding course material such as lecture notes and recordings, questions, and/or quiz/exam reviews.
      </h4>
        </div>
    </div>
  )
}
export default AboutCont;
